    <div>
      <h1>Welcome to the National Park Service Online Tour Guide!</h1>
      <div class="btn-group">
        <a href="#" class="btn btn-primary">
          Download
        </a>
        <a href="#" class="btn btn-primary">
          Mirror
        </a>
      </div>
    </div>
  );
}

export default Home;
